import React, { Component } from 'react';
import Search from "./components/search/Search";
import Title from './Title';
import './App.css';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider'

class App extends Component{
  render(){
    return(
      <MuiThemeProvider>

      <div className="App">
      <Title />
      </div>
      <div>
      <Search />
      </div>
      </MuiThemeProvider>
    )
  }
}

export default App;
